import React, { useState, useCallback } from "react";

import Buttons from "./Button";
const App = () => {
  const [count, setCount] = useState(0);
  const increment = () => {
    console.log("setting count");
    setCount(count + 1);
    console.log(count);
  };

  return (
    <div>
      <div> Hello World</div>
      {console.log("rendering")}
      <br />
      <div>Increment</div>
      <br />

      <Buttons />
    </div>
  );
};

export default App;
